from video import *
from collections import deque  # 双端队列
from abc import ABC, abstractmethod
from transformtile import Tile_counter as Tile
import math

class Statistics(ABC):
    def __init__(self, real_coordinates, pre_coordinates):
        self.real_coordinates = deque(real_coordinates)  # 这里拷贝了（亲测）
        self.pre_coordinates = deque(pre_coordinates)
    @abstractmethod
    def execute(self):
        pass

    def trans_coordinates(self, coordinates):
        frame = coordinates[0]
        yaw = math.radians(coordinates[1])
        pitch = math.radians(coordinates[2])
        yaw_d1_t = math.sin(yaw)
        yaw_d2_t = math.cos(yaw)
        yaw_t = math.degrees(math.atan(yaw_d1_t / yaw_d2_t))
        pitch_d1_t = math.sin(pitch)
        pitch_d2_t = math.cos(pitch)
        pitch_t = math.degrees(math.atan(pitch_d1_t / pitch_d2_t))
        return [frame, yaw_t, pitch_t]

class Accuracy(Statistics):
    def execute(self):
        error_tolerance = Configuration().error_tolerance
        true = 0
        false = 0
        real = self.real_coordinates
        predict = self.pre_coordinates
        #print(len(self.pre_coordinates))
        while len(predict) != 0:
            cur_coordinates = real.pop()
            pre_coordinates = predict.pop()
            # cur_frame = cur_coordinates[0]
            cur_yaw = cur_coordinates[1]
            cur_pitch = cur_coordinates[2]
            # pre_frame = pre_coordinates[0]
            pre_yaw = pre_coordinates[1]
            pre_pitch = pre_coordinates[2]
            distance_yaw = abs(cur_yaw - pre_yaw)
            distance_pitch = abs(cur_pitch - pre_pitch)
            if distance_yaw <= error_tolerance and distance_pitch <= error_tolerance:
                true += 1
            else:
                false += 1
        accuracy = true / (true + false)
        print("正确率为：", accuracy)
        return accuracy

