class Mean(Statistics):
    def execute(self):
        result_yaw = []
        result_pitch = []
        real = self.real_coordinates
        predict = self.pre_coordinates
        #print(len(self.pre_coordinates))
        length = len(predict)
        while len(predict) != 0:
            cur_coordinates = real.pop()
            pre_coordinates = predict.pop()
            # cur_frame = cur_coordinates[0]
            cur_yaw = cur_coordinates[1]
            cur_pitch = cur_coordinates[2]
            # pre_frame = pre_coordinates[0]
            pre_yaw = pre_coordinates[1]
            pre_pitch = pre_coordinates[2]
            distance_yaw = abs(cur_yaw - pre_yaw)
            distance_pitch = abs(cur_pitch - pre_pitch)
            result_yaw.append(distance_yaw)
            result_pitch.append(distance_pitch)
        result_yaw.sort(reverse=False)
        result_pitch.sort(reverse=False)
        if int(length) % 2 == 1:
            mean_yaw = result_yaw[int((length + 1) / 2)]
            mean_pitch = result_pitch[int((length + 1) / 2)]
        else:
            mean_yaw = (result_yaw[int(length / 2)] + result_yaw[int(length / 2 + 1)]) / 2
            mean_pitch = (result_pitch[int(length / 2)] + result_pitch[int(length / 2 + 1)]) / 2
        print("yaw的中位数是：", mean_yaw)
        print("pitch的中位数是：", mean_pitch)
        return mean_yaw, mean_pitch

