class TileAccuracy(Statistics):
    def __init__(self, real_coordinates, pre_coordinates):
        Statistics.__init__(self, real_coordinates, pre_coordinates)
        self.result = deque()
        self.waste = deque()
    def execute(self):
        real = deque(self.real_coordinates)
        predict = deque(self.pre_coordinates)
        #length = len(predict)
        while len(predict) != 0:
            cur_coordinates = self.trans_coordinates(real.pop())
            pre_coordinates = self.trans_coordinates(predict.pop())
            cur_tiles = list(Tile().counter(cur_coordinates[1], cur_coordinates[2]))
            pre_tiles = list(Tile().counter(pre_coordinates[1], pre_coordinates[2]))
            true = 0
            false = 0
            for elem in pre_tiles:
                key = cur_tiles.count(elem)
                # print(key)
                if key == 1:
                    true += 1
                elif key == 0:
                    false += 1
            self.result.appendleft(true / len(cur_tiles))
            self.waste.appendleft(false / len(cur_tiles))
            accuracy = sum(self.result)/len(self.result)
        print("tile正确率为", accuracy)
        return accuracy


